import {Navbar,Nav, Form, Container, FormControl, Button } from 'react-bootstrap';
import './bootstrap.min.css';
import {NavLink} from 'react-router-dom';
import useHistory from "react-router-dom";


import React from 'react'

const Topbar = () => {

  const history = useHistory();
  async function handleLogout() {
    await Auth.signOut();

    userHasAuthenticated(false);

    history.push("/login");
  }
  return (
    <Navbar bg="light" expand="lg">
  <Container fluid>
    <Navbar.Brand href="/" style={{ fontWeight:'bold',fontSize:25 ,  padding: 10 }}>LOGO</Navbar.Brand>

      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}>

        <NavLink to="/User" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>Users</NavLink> <br/>

        <NavLink to="/Products" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>Products</NavLink><br/>

        <NavLink to="/AddProducts" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>New</NavLink><br/>

        <NavLink to="/Reviews" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>Review</NavLink><br/>

        <Nav>
            <Form className="d-flex">
        <FormControl
          type="search"
          placeholder="Search"
          aria-label="Search"
        />

      </Form>
      </Nav>
      </Nav>
      <Nav><Button onClick={handleLogout}  style={{ fontWeight:'bold',fontSize:20 ,  padding: 20 }}>Logout</Button></Nav>


  </Container>
</Navbar>
  )
}

export default Topbar
